import React, { Fragment } from 'react'
import Button from '../../common/button'
import TableIcons from '../../common/materialicon';
import { green } from '@material-ui/core/colors';

export default class SuccessUnmapPin extends React.Component{
    constructor(props){
        super(props);
        this.state={

        }
    }

    onCompleteClick = () => {
        this.props.data.callback();
        this.props.onCancelClick();
    }

    componentDidMount() {
        console.log(this.props);
    }

    render(){
        return(
            <Fragment>
                <div style={styles.TitleModal} >
                    Xóa PINCode
                </div>
                <div style= {styles.styleContent}>
                    <div>
                    <TableIcons.DoneAll style={{ color: green[500], fontSize: 60}}/> 
                    </div>
                    <div>
                        Xóa PinCode thành công
                    </div>
                </div>
                <div style={styles.GroupButton}>
                    <Button onClick={this.onCompleteClick}
                    title={'Hoàn thành'}/>
                </div>
            </Fragment>
        )
        
    }
}

const styles ={
    styleContent: {
    width: 'auto',
    textAlign: 'center',
    overflow: 'hidden',
    display: 'block',
    padding: '60px 10px',
    fontWeight: 'bold',
    fontSize: '25px'
    },
    TitleModal: {
        fontSize: '21px',
        fontWeight: 600,
        color: 'rgb(227, 6, 19)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        height: '30px',
        paddingTop: '25px',
        paddingBottom: '15px',
        textAlign: 'center'
    },
    GroupButton: {
        marginTop: '50px',
        height: '70px',
        borderTop: '1px solid red',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
}
